package cn.edu.cqu.stringalgorithm;

import java.util.HashMap;

public class ValidAnagram {
    public static void main(String[] args) {
        System.out.println(isAnagram("",
                                     ""));
    }

    public static boolean isAnagram(String s, String t){
        if(s.length() != t.length())
            return false;
        HashMap<Character, Integer> smap = new HashMap<>();
        HashMap<Character, Integer> tmap = new HashMap<>();
        smap = countStr(s);
        tmap = countStr(t);
        for(Character character : smap.keySet()){
            if((!tmap.containsKey(character)) ||
                    !tmap.get(character).equals(smap.get(character))) {
                return false;
            }
        }
        return true;
    }

    public static HashMap<Character, Integer> countStr(String s){
        HashMap<Character, Integer> smap = new HashMap<>();
        for (int i = 0; i < s.length(); i++) {
            if(smap.containsKey(s.charAt(i))){
                int temp = smap.get(s.charAt(i)) + 1;
                smap.put(s.charAt(i), temp);
            }else{
                smap.put(s.charAt(i), 0);
            }
        }
        return smap;
    }
}
